(()=>{var doms=document.getElementsByClassName("entry-content")[0].getElementsByClassName("alignnone"),urls=[];for(dom of doms){var arr=dom.srcset.split(/w, | |w$/),size=[],url=[],max={size:0,url:""};for(i in arr)i%2?size.push(+arr[i]):url.push(arr[i]);for(i in size)size[i]>max.size&&(max.size=size[i],max.url=url[i]);urls.push(max.url)}makeDOM(urls)})();